import React from 'react'

function About() {
  return (
    <div className="About">
        <div>
    <img src="https://via.placeholder.com/400" alt="About" />
  </div>
  <div className="about-card-content">
    <h2>About Our Company</h2>
    <p>
      We are a company dedicated to providing top-tier services. Our team
      works relentlessly to bring innovation and value to our customers. With
      years of experience, we are proud to be at the forefront of our industry,
      delivering high-quality solutions and creating long-lasting relationships.
    </p>
  </div>
  </div>
  );
}

export default About;
